import React from 'react';
import logo from './logo.svg';
import './App.css';

const NumberContext = React.createContext();

function App() {
  return (
    <div className="App">
     <NumberContext.Consumer>
       <NumberContext.Provider value={7}>

       </NumberContext.Provider>
     </NumberContext.Consumer>
    </div>
  );
}

export default App;
